// Hooks
import { useCount } from "./hooks/useCount";

// Components
import { Button } from "./components/Button";

export const App = () => {

// Hooks
const [clicks, noMemoizedClick, memoizedClick] = useCount(0)

  return (
    <div>
      <p>{clicks}</p>
      <Button onClick={noMemoizedClick} name={'Button1'} />
      <Button onClick={memoizedClick} name={'Button2'} />
    </div>
  );
}
